// stores messages in a fifo until the specified number have been received, 
// then releases them as new messages are received.
// during the filling phase the earliest message is passed on each time 
// a message is received, but it is also left in the fifo
var fifoMaxLength = 2;
var fifo = context.get('fifo') || [];
// push the new message onto the top of the array, messages are shifted down and
// drop off the front
var length = fifo.push(msg);  // returns new length
if (length > fifoMaxLength) {
    newMsg = fifo.shift();
} else {
    // not full yet, make a copy of the msg and pass it on
    var newMsg = JSON.parse(JSON.stringify(fifo[0]));
}
context.set('fifo', fifo);
return newMsg;

var spm = msg.payload;//spm seteada por la entrada
var PoleaGrande = global.get("C2S.Motor_Control.Nameplate.PoleaGrande")||0;
var PoleaPequena = global.get("C2S.Motor_Control.Nameplate.PoleaPequena")||0;
var RGB = global.get("C2S.Motor_Control.Nameplate.RGB")||0;
var RPM = global.get("C2S.Motor_Control.Nameplate.RPM")||0;
var HertzMotor = global.get("C2S.Motor_Control.Nameplate.Hertz")||0;

// guardar las variables
context.set("spm", spm, "memoryOnly");
context.set("PoleaGrande", PoleaGrande, "memoryOnly");
context.set("PoleaPequena", PoleaPequena, "memoryOnly");
context.set("RGB", RGB, "memoryOnly");
context.set("HertzMotor", HertzMotor, "memoryOnly");
context.set("RPM", RPM, "memoryOnly");
context.set("relSRP1", relSRP1, "memoryOnly");
context.set("relSRP2", relSRP2, "memoryOnly");

if ((PoleaGrande != 0) && (RGB != 0) && (RPM != 0) && HertzMotor!= 0){
    node.status({fill:"green",shape:"dot",text:"Configurado"});
    var relSRP1 = spm*PoleaGrande*RGB*HertzMotor;
    var relSRP2 = RPM*PoleaPequena
    if(relSRP2 != 0){//ejecute si la relacion de SRP2 está correcta
        var hz = relSRP1/relSRP2;
        hz = parseFloat(hz.toFixed(4));//redondeo a 4 cifras
        msg.payload = hz;
        context.set("hz", hz, "memoryOnly");
        // setea la variable global
        global.set("Input.Operation.Reference", hz, "memoryOnly");
        global.set("C2S.Last_Reference.Value", hz, "memoryOnly");
        global.set("Input.Operation.spm", spm, "memoryOnly");
        return msg;
    }

}else{
    node.status({fill:"red",shape:"dot",text:"NoConfigurado"});
}

var InputSeconds = msg.payload;
if(InputSeconds >= 0){
    // si no genera numeros negativos
    var Days = parseInt(InputSeconds / 86400);
    var Hours = parseInt((InputSeconds - (Days) * 86400) / 3600);
    var SegRest = parseInt(InputSeconds - (Hours * 3600) - (Days * 86400));
    var Min = parseInt(SegRest / 60);
    var seconds = parseInt(SegRest - (Min * 60));

    // conversion a string
    Days = Days.toString()
    Hours = Hours.toString()
    Min = Min.toString()
    seconds = seconds.toString()
    //concatenacion
    var date = Days; date += ":"; date += Hours; date += ":"; date += Min; date += ":";date += seconds;
    // retornar el mensaje
    msg.payload = date;
    // guardar las variables
    context.set("Days", (Days),"memoryOnly");
    context.set("InputSeconds", InputSeconds, "memoryOnly");
    context.set("Hours", Hours, "memoryOnly");
    context.set("SegRest", SegRest, "memoryOnly");
    context.set("Min", Min, "memoryOnly");
    context.set("seconds", seconds, "memoryOnly");
    context.set("date", date, "memoryOnly");
    return msg;
}

