if (habilitado == true && comunicacion == true && FallaGeneral == false) {
    //visualizar estado del habilitado
    color = "green";
    if (toff != 0 && ton != 0) {
        // logica para cambiar entre estados
        if (AutomaticRestart == true && flagArranqueAutomatico == false){
            node.status({ fill: "yellow", shape: "dot", text: "esperandoArranque" });
            buttonComand = false;//se ejecuta una sola vez
            estado = true;
            flagArranqueAutomatico = true;//ya se ejecuto el arranque automatico
        }else if(flagArranqueAutomatico == true){
            buttonComand = true;//inicie la operación
            flagArranqueAutomatico = false;
        }
        if (estado == true && buttonComand == true ) {
            color = "green";
            if (At_Setpt_Spd == 1){//El VSD ya llegó a la referencia
                ctr = ctr + 1;
                flag = true;
            }else if(flag == true){//seguir contando el tiempo
                ctr = ctr + 1;
            }
            else{
                ctr = ctr;//No aumente el tiempo
            }
            context.set("ctr", ctr)//guardar contador
            time = ton - ctr;
            if (ton == ctr) {
                global.set("Control_functions.Controlon_off.estado", false);
                context.set("ctr", 0)//setear el contador
            } else if (ctr > ton) {
                //caso en el cual se cambia el tiempo del contador pot pantalla
                context.set("ctr", 0)//setear el contador
            }
        } else if (estado == false && buttonComand == true){
