            context.set("ctr", ctr)//guardar contador
            time = toff - ctr;
            if (toff == ctr) {
                global.set("Control_functions.Controlon_off.estado", true);
                context.set("ctr", 0)//setear el contador
            } else if (ctr > toff) {
                //caso en el cual se cambia el tiempo del contador pot pantalla
                context.set("ctr", 0)//setear el contador
            }
        }else {
            estado = "pausa";
            time = 0;
        }

    } else {
        color = "red"
        time = 0;
        estado = "tiemposNoConfigurados";
        flag = false;
    }
