var InputSeconds = msg.payload;
if(InputSeconds >= 0){
    // si no genera numeros negativos
    var Days = parseInt(InputSeconds / 86400);
    var Hours = parseInt((InputSeconds - (Days) * 86400) / 3600);
    var SegRest = parseInt(InputSeconds - (Hours * 3600) - (Days * 86400));
    var Min = parseInt(SegRest / 60);
    var seconds = parseInt(SegRest - (Min * 60));

    // conversion a string
    Days = Days.toString()
    Hours = Hours.toString()
    Min = Min.toString()
    seconds = seconds.toString()
    //concatenacion
    var date = Days; date += ":"; date += Hours; date += ":"; date += Min; date += ":";date += seconds;
    // retornar el mensaje
    msg.payload = date;
    // guardar las variables
    context.set("Days", (Days),"memoryOnly");
    context.set("InputSeconds", InputSeconds, "memoryOnly");
    context.set("Hours", Hours, "memoryOnly");
    context.set("SegRest", SegRest, "memoryOnly");
    context.set("Min", Min, "memoryOnly");
    context.set("seconds", seconds, "memoryOnly");
    context.set("date", date, "memoryOnly");
    return msg;
}

