var Start_SurfaceControl = global.get("Control_functions.SurfaceControl.buttonComand")||false;
var ctr2 = context.get("ctr2", ctr2) || 0;
var DisparoBreaker = flow.get("Control_functions.SurfaceControl.Disparo")||false;
var Tiempo_susp = global.get("Control_functions.SurfaceControl.time_susp")||0;
var POC_actual = flow.get("POC_actual") || 0;

if(Start_SurfaceControl == false){
    flow.set("Control_functions.SurfaceControl.Disparo",false);

}

if (comunicacion == true && habilitadoCS == true && Start_SurfaceControl == true){

    if (DisparoBreaker == true && Estado_Dinagrama == false) {//Empieza el conteo de suspensión del control para despues volver evaluar.
        ctr2 += 1; //contador para el tiempo de espera
        context.set("ctr2", ctr2)
        time = Tiempo_susp - ctr2;
        if (Tiempo_susp == ctr2) {
            POC_actual = 0;//setea el número de intentos
            flow.set("POC_actual", POC_actual);
            DisparoBreaker = false;
            flow.set("Control_functions.SurfaceControl.Disparo", DisparoBreaker);
            global.set("Control_functions.SurfaceControl.Estado_Dinagrama", true);
            global.set("Control_functions.Controlon_off.buttonComand",true);
            context.set("ctr2", 0)//setear el contador
            Alert_Intentos2 = {payload:POC_actual};
            Alert_Dinagrama = { payload: "Se encenderá el equipo,Calculando Punto de Operación" };
            time = { payload: time };
            Estado_Dinagrama = { payload: true };
            return [Estado_Dinagrama, time, Alert_Dinagrama,Alert_Intentos2];
        } else if (ctr2 > Tiempo_susp) {
            //caso en el cual se cambia el tiempo del contador por pantalla
            context.set("ctr2", 0)//setear el contador
        }
        time = { payload: time };
        Estado_Dinagrama = { payload: Estado_Dinagrama };
        return [Estado_Dinagrama, time, Alert_Dinagrama];
    }
    return [Estado_Dinagrama, time, Alert_Dinagrama];

} else if (habilitadoCS == false && comunicacion == true) {
    context.set("ctr2", 0);
    time = Tiempo_susp;
    return [Estado_Dinagrama, time, Alert_Dinagrama, Alert_Intentos2];
}
if (comunicacion == false) {
    Estado_Dinagrama = { payload: false };
    time = { payload: 0 };
    return [Estado_Dinagrama, time, Alert_Dinagrama];
}    

if (Start_SurfaceControl == false && comunicacion == true) {
    ctr2 = 0;
    context.set("ctr2", ctr2);
    DisparoBreaker = false;
    context.set("DisparoBreaker", DisparoBreaker, "memoryOnly");
    flow.set("Control_functions.SurfaceControl.Disparo", false);
    time = { payload: 0 };
    return [Estado_Dinagrama, time, Alert_Dinagrama];

}

context.set("time",time);
context.set("ctr2",ctr2);
context.set("Tiempo_susp",Tiempo_susp);
context.set("habilitadoCS", habilitadoCS, "memoryOnly");
context.set("Estado_Dinagrama", Estado_Dinagrama, "memoryOnly");
context.set("DisparoBreaker", DisparoBreaker,"memoryOnly");

var habilitado = global.get("Control_functions.ControlDownhole.habilitado")||false;
var buttonComand = global.get("Control_functions.ControlDownhole.buttonComand")||false;
var time = global.get("Control_functions.ControlDownhole.time")||0;//tiempo para rearrancar
var state = global.get("Control_functions.ControlDownhole.state") || "Normal";//estado general del control
var ctr = context.get("ctr","memoryOnly")||0;//contador interno
var At_Setpt_Spd = global.get("C2S.Drive_Status.At_Setpt_Spd", "memoryOnly") || 0;//llegó a referencia el VSD
var comunicacion = global.get("C2S.Comunicacion_Drive", "memoryOnly") || false;//comunicación con el drive
var contador,comando,color;//Variables Visualizadoras
if (habilitado == true && buttonComand == true && comunicacion == true){
    if (state == "Disparo"){
        comando = false;//Dispare el equipo
        if (At_Setpt_Spd == 0){
            ctr = ctr + 1;//aumnetar el conteo
        }else{
            ctr = ctr;
        }
        contador = time - ctr;//visualizar de tiempo
        if(ctr >= time){//cuando ya cumplio el tiempo
            comando = true;
            state = "Normal"; color = "green";
            ctr = 0;
        }else{
            ctr = ctr;
        }
    } else if (state == "Alarma"){// estado de alarma
        color = "yellow";
        contador = 0;
    } else if (state == "Normal"){
        contador = 0;
    }
} else if (habilitado == true && buttonComand == false && comunicacion == true){//habilitado pero no arrancado
    state = "esperandoArranque"
    color = "red";
    contador = 0;
}else if(comunicacion == false){
    state = "falloComunicación"
    color = "blue";
    contador = 0;
}
else{//deshablitado
    state = "Deshabilitado"
    color = "red";
    contador = 0;
}
// variables globales
global.set("Control_functions.ControlDownhole.state",state);
// visualización
node.status({fill:color,shape:"dot",text:state});

context.set("habilitado", habilitado,"memoryOnly");
context.set("time", time,"memoryOnly");
context.set("state", state,"memoryOnly");
context.set("ctr", ctr,"memoryOnly");
context.set("At_Setpt_Spd", At_Setpt_Spd,"memoryOnly");
context.set("comunicacion", comunicacion,"memoryOnly");
return [{payload:comando},{payload:state},{ payload:contador}];

