var habilitado = global.get("Control_functions.ControlDownhole.habilitado") || false;
var LL = global.get("Control_functions.ControlDownhole.LL") || 0;
var L = global.get("Control_functions.ControlDownhole.L") || 0;
var Fillage = global.get("Control_functions.ControlDownhole.Fillage") || 0;
var state = global.get("Control_functions.ControlDownhole.state") || "Normal";
var intentosHMI = global.get("Control_functions.ControlDownhole.intentosHMI") || 0;
var intentos = context.get("intentos","memoryOnly")||0;
var color;
if(habilitado == true){
    if (Fillage <= LL && state != "Disparo"){//aumentar intento
        intentos = intentos + 1;
        global.set("Control_functions.ControlDownhole.intentos", intentos);
        if (intentos >= intentosHMI){//genere el disparo
            state = "Disparo";color = "red";
            msg.payload = "Disparo Poc DownholeControl";
            msg.topic = "Poc Control";
            intentos = 0; // setee el contador
        }
    }else if(Fillage <= L && Fillage > LL){//Alarma por bajo 
        state = "Alarma";color = "yellow";
        msg.payload = "Alarma Poc DownholeControl";
        msg.topic = "Poc Control";
    } else if (state == "Disparo"){
        state = "Disparo";color = "red";
    }else{
        state = "Normal";color = "green";
    }
    node.status({fill:color,shape:"ring",text:state});
    context.set("intentos", intentos,"memoryOnly");
    context.set("intentosHMI", intentosHMI,"memoryOnly");
    context.set("mensaje", msg.payload,"memoryOnly");
    context.set("L", L,"memoryOnly");
    context.set("LL", LL,"memoryOnly");
    context.set("state", state,"memoryOnly");
    context.set("Fillage", Fillage,"memoryOnly");
    // variables globales
    global.set("Control_functions.ControlDownhole.state",state);
}else{
    //si esta deshablitado
    context.set("intentos",0,"memoryOnly");//setear el contador
    node.status({fill:"red",shape:"ring",text:habilitado});
}
state = { payload: state}
intentos = {payload: intentos}
return [state,intentos];

